        return new Source("{% extends 'base.html.twig' %}

{% block title %}Category index{% endblock %}

{% block body %}
    <h1>Category index</h1>

    <table class=\"table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>Name</th>
                <th>Description</th>
                <th>Color</th>
                <th>Icon</th>
                <th>IsActive</th>
                <th>Position</th>
                <th>Visibility</th>
                <th>TaskLimit</th>
                <th>CreateAt</th>
                <th>UpdateAt</th>
                <th>No</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for category in categories %}
            <tr>
                <td>{{ category.id }}</td>
                <td>{{ category.name }}</td>
                <td>{{ category.description }}</td>
                <td>{{ category.color }}</td>
                <td>{{ category.icon }}</td>
                <td>{{ category.isActive ? 'Yes' : 'No' }}</td>
                <td>{{ category.position }}</td>
                <td>{{ category.visibility }}</td>
                <td>{{ category.taskLimit }}</td>
                <td>{{ category.createAt ? category.createAt|date('Y-m-d H:i:s') : '' }}</td>
                <td>{{ category.updateAt ? category.updateAt|date('Y-m-d H:i:s') : '' }}</td>
                <td>{{ category.no }}</td>
                <td>
                    <a href=\"{{ path('app_category_show', {'id': category.id}) }}\">show</a>
                    <a href=\"{{ path('app_category_edit', {'id': category.id}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"13\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

    <a href=\"{{ path('app_category_new') }}\">Create new</a>
{% endblock %}
